import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import ListaFilmes from "./components/ListaFilmes/index";
import Filme from "./components/ListaFilmes/Filme/index"
import Home from "./components/Home/index";
import Erro from "./components/Erro/index";
import Header from "./components/Header/index"

const Routes = () => {
    return(
        <BrowserRouter>
            <Header/>
            <Switch>
                <Route exact path = "/" component = {Home}/>
                <Route exact path = "/listaFilmes/" component = {ListaFilmes}/>
                <Route exact path = "/listaFilmes/:id" component = {Filme}/>
                <Route path = "*" component = {Erro}/>
            </Switch>
        </BrowserRouter>
    );
}

export default Routes;
